<h3>经济含义：</h3>
<p>该指数具有明确的经济含义，表示人民币汇率变动率提高一单位造成的其它国家货币汇率的平均净变动幅度，衡量了人民币汇率带动“一带一路”区域主要货币汇率同向变动的能力。</p>
